import './Calc.css'

let Calc = (props) => {

    return (
    <div className='Calc'>
            <form className='Form'> 
            Sell <input type='number' defaultValue='0.000' min='0' onChange={props.onChange}></input> {props.val1}
            <br></br>
            Buy  <input type='number' value={props.cost2} readOnly></input> {props.val2}
            </form>  

    </div>)}

export default Calc
